import React, {Component} from 'react';
import Header from './header';
import Call_action from './call_action';
import Footer from './footer';

class Home extends Component{
    render(){
       
        return(
            <div className="about_page">
                <div className="wellcom_banner">
                    <Header />
                </div>
                <div className="about_wrap">
                    <div className="container">
                        <h3>Newdex Failed Transfer Announcement</h3>
                        <p>All transactions on Newdex are transfer on chain, it may fail when the turnover is too heavy.</p>
                        <p>Please don’t worry when you don’t receive your Token, Newdex will fix it soon.</p>
                        <p>Or you can contact us and leave feedback, we are glad to help you.</p>
                        <p>This is the link to contact us,please feel free to leave note if you have any question.</p>
                    </div>
                </div>
                <Call_action />
                <Footer />
            </div>
        )
    }
}

export default Home;
